public class Solution {
    public int StringCount(int n) {
        const int MOD = 1000000007;
        if (n < 4) return 0;
        long res = 1;
        for (int i = 1; i <= n - 4; i++) {
            res = res * 26 % MOD;
        }
        long count = res * 24 % MOD; // for the "leet" permutation
        if (n == 4) return (int)count;
        long combo = (n - 4) * (n - 3) % MOD * (n - 2) % MOD * (n - 1) % MOD * 621085416 % MOD; // 621085416 is the modular inverse of 24*23*22*21 in MOD
        count = count * combo % MOD;
        return (int)count;
    }
}
